FeedPackage.Description:
HttpHelper：

Example：

HttpHelper.Helper.Get(HttpHelper.CraeteParameter(url, dic), Encoding.UTF8);

HttpHelper.Helper.Get<BaiduTranslation.Result>(HttpHelper.CraeteParameter(url, dic), Encoding.UTF8);

HttpHelper.Helper.Post(Url, dic, Encoding.UTF8, Encoding.UTF8)

HttpHelper.Helper.Post<BaiduTranslation.Result>(Url, dic, Encoding.UTF8, Encoding.UTF8)



BaiduTranslation：

Example：

  BaiduTranslation tran = new BaiduTranslation("201607130******", "*******");

BaiduTranslation.Result result = tran.Get(new BaiduTranslation.Request()
{
      Query = "Helper",
      From = BaiduTranslation.Language.auto,
      To = BaiduTranslation.Language.cht
});

Console.WriteLine(JsonConvert.SerializeObject(result));

if (string.IsNullOrEmpty(result.error_code))
{
       foreach (var trans in result.trans_result)
       {
             Console.WriteLine("{0}=>{1}", trans.src, trans.dst);
       }
}
